Friendly adult male dog 3.5 yr, 68 pounds, dog friendly


Buddy is a soft-spoken gentle chocolate lab mix with a tender heart. He is easy going and would be happy with a family or owner that enjoys going for walks or spending time by the fire! He can be shy and would do best with dogs that don't overwhelm him. He might be OK with cats and we can do further cat testing if needed.
